import React from "react";

class Calculations extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      firstNum: null,
      secondNum: null
    };
  }

  render() {
    return this.inputForm();
  }

  inputForm = () => {
    return (
      <form onSubmit={this.handleSubmit}>
        <div class="form-row" id="container">
          <div class="col-5">
            <input
              type="number"
              class="form-control"
              placeholder="First Number"
              required
            />
          </div>
          <div class="col-5">
            <input
              type="number"
              class="form-control"
              placeholder="Second Number"
              required
            />
          </div>
          <div class="col-2">
            <button type="submit" class="btn btn-primary">
              Calculate
            </button>
          </div>
        </div>
      </form>
    );
  };
}

handleSubmit = event => {
  console.log(event);
};

export default Calculations;
